import { string } from "random-js";

const topicReducer = (state, action) => {
  console.log("action type", action.type)
  switch (action.type) {
    default:
      state = '';
      break;
    case 'addition':
      state = 'addition';
      break;
    case 'subtraction':
      state = 'subtraction';
      break;
    case 'multiply': 
      state = 'multiply';
      break;
    case 'divide':
      state = 'divide';
  }
  return state;
}

export default topicReducer;
